import React from 'react';
import {Link} from 'react-router-dom';

export default function Contact(){
    return (
        <div class="content">
            <h3>Contact Me</h3>
            <figure id="contacts_links">
                <a class="img_container" href="https://github.com/elnukakujo" target="_blank">
                    <img src="assets/img/logo/github_logo.jpg" alt="GitHub"/>
                </a>
                <a class="img_container" href="https://www.linkedin.com/in/no%C3%A9-jager-2b4866236/" target="_blank">
                    <img src="assets/img/logo/linkedin_logo.jpg" alt="Linkedin"/>
                </a>
                <a class="img_container" href="mailto:noe.p.jager@gmail.com"target="_blank">
                    <img src="assets/img/logo/gmail_logo.jpg" alt="Gmail" />
                </a>
            </figure>
        </div>
    )
}
